import React, { Component } from "react";
import Stack from "@mui/material/Stack";
import { Link } from "react-router-dom";

import Button from "@mui/material/Button";

class LandingPage extends Component {
  constructor(props) {
    super(props);
  }
  state = { redirtologin: false, redirtosignup: false };
  render() {
    // let redirtologin = null;
    // if (this.state.redirtologin) {
    //   redirtologin = <Redirect to="/signin" />;
    // }
    // let redirtosignup = null;
    // if (this.state.redirtosignup) {
    //   redirtosignup = <Redirect to="/signup" />;
    // }
    return (
      <>
        <div>
          <div style={{ width: "600px !important" }}></div>
          <Stack spacing={2} direction="row">
            <button
              style={{
                padding: "10px",
                background: "#add8e6",
                border: "0px",
                borderRadius: "5px",
                paddingLeft: "20px",
              }}
            >
              <Link
                to="/signin"
                style={{
                  textDecoration: "none",
                  color: "white",
                }}
              >
                Login
              </Link>
            </button>
            <button>
              <Link
                to="/signup"
                style={{ textDecoration: "none", color: "white" }}
              >
                SignUp
              </Link>
            </button>
          </Stack>
        </div>
      </>
    );
  }
}

export default LandingPage;
